script: |
  super -f text -I q10178.spq | sort > q10178.out

inputs:
  - name: q10178.spq
    data: |
      SELECT DISTINCT col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL <= NULL OR + ( - - col2 ) NOT BETWEEN ( - + col2 + col1 * - col2 * + col2 * - CAST ( + col2 AS REAL ) ) AND - col2;
  - name: tab2

outputs:
  - name: q10178.out
    data: |
      51
      67
      77
